public class CISQueue<T> { private SinglyLinkedList<T> list;public CISQueue(T value) {list = new SinglyLinkedList<>(value);}public boolean isEmpty() {if (list.size()>0) {return false;}return true;}public int size() {return list.size();}public T dequeue() {return (T)list.removeFirst();}public void enqueue(T value) {list.addLast(value);}public String toString() {return list.toString();}}